import React from "react"
import Home from "../home"
import DrugInputs from "../druginput"
import ViewDrugs from "../ViewDrugs"

export default [
    {
        path: "/",
        e: <Home/>
    },
    {
        path: "/druginputs",
        e: <DrugInputs/>
    },
    {
        path: "/viewdrugs",
        e: <ViewDrugs/>
    }

]
